  false,\n\t\"url\": null,\n\t\"notes\": \"Fishery management planning on the Upper
  Mississippi River National Wildlife and Fish Refuge provides the framework for cooperative
  management with state agencies directed toward meeting Master Plan goals and objectives
  which relate to fishery resources and to maintain these resources for the enjoyment
  of this and future generations. This plan is designed as an interim management scheme
  which outlines initial strategies necessary for the development of a long range
  fishery management plan.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
